import React from 'react'
import {
  Container,
  Jokes,
  IncrementButton,
  DecrementButton,
  SaveButton,
} from './styles/savedJokes'

export default function SavedJokes({ children, ...restProps }: any) {
  return <Container {...restProps}>{children}</Container>
}

SavedJokes.IncrementButton = function handleIncrementButton({
  children,
  ...restProps
}: any) {
  return <IncrementButton {...restProps}>{children}</IncrementButton>
}

SavedJokes.DecrementButton = function handleDecrementButton({
  children,
  ...restProps
}: any) {
  return <DecrementButton {...restProps}>{children}</DecrementButton>
}

SavedJokes.SaveButton = function handleSaveButton({
  children,
  ...restProps
}: any) {
  return <SaveButton {...restProps}>{children}</SaveButton>
}

SavedJokes.Jokes = function displayJokes({ children, ...restProps }: any) {
  return <Jokes {...restProps}>{children}</Jokes>
}
